import React from 'react';
import ToDoListItem from './ToDoListItem';



export default class ToDoList extends React.Component{

    toDoList = ["Go to School", "Do Homeworks", "Come home"];

    listItems = toDoList.map((listItem, index)=>{
        <ToDoListItem listItem={listItem} key={index} id={index}></ToDoListItem>
    })
    render(){        
        return <ToDoListItem list={this.toDoList}></ToDoListItem>;
    }

}
